import React, { useState } from 'react';

const FetchDataPage = () => {
  const [name, setName] = useState('');
  const [fetchedData, setFetchedData] = useState('');

  const handleFetchData = async () => {
    try {
      const response = await fetch(`/api/entries?name=${name}`);
      const result = await response.json();

      if (result) {
        setFetchedData(`Name: ${result.name}, Phone: ${result.phone}, Email: ${result.email}`);
      } else {
        setFetchedData('No data available');
      }

      console.log(result);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div>
      <h2>Fetch Data</h2>
      <label htmlFor="name">Name:</label>
      <input type="text" value={name} onChange={(e) => setName(e.target.value)} />
      <br />
      <button onClick={handleFetchData}>Submit</button>
      <div>
        <strong>Fetched Data:</strong> {fetchedData}
      </div>
    </div>
  );
};

export default FetchDataPage;
